import React from "react";
import { Container, Row, Col } from "reactstrap";
import { popularMenuFood } from '../../assets/fake-data/products'; // Asegúrate de que los datos se importen correctamente
import ProductCard from "../product-card/ProductCard";
import "./popular-menu.css";

const PopularMenu = () => {
    // Filtrar productos con id igual a 1
    const filteredProducts = popularMenuFood.filter(item => item.id === 1);

    return (
        <section className="pt-0">
            <Container>
                <Row>
                    <Col lg='12' className="mb-5">
                        <h2 className="popular__menu-title">Popular food Menu</h2>
                    </Col>
                    {filteredProducts.map(item => (
                        <Col lg='3' md='4' sm='6' xs='6' className='mb-4' key={item.id}>
                            <ProductCard item={item} />
                        </Col>
                    ))}
                </Row>
            </Container>
        </section>
    );
};

export default PopularMenu;
